import { useNavigate } from 'react-router-dom'
import React from 'react'
import './css/log_options.css'
import cart from '../../img/svg/cart.svg'
import favlist from '../../img/svg/favlist.svg'

export default function LogOptions({setUSer}) {
    const navigate = useNavigate();
    const redirectLogin = () => {
        navigate('/Login');
    };
    const redirectRegister = () => {
        navigate('/Register');
    };
    const handleLogOut = () => {
        setUSer([])
    }
    return(
        <section class="section__log_options">
            <div className='svg_center'>
                <img src={favlist} title="Lista de favoritos" />
            </div>
            <div className='svg_center'>
                <img src={cart} title="Compras" />
            </div>
            <button onClick={handleLogOut} className='logout_btn'>Cerrar sesion</button>
            <button className='options_btn logout_btn'>Opciones</button>
        </section>
    )
}
